    <div className='container' style={{textAlign:'center'}}>
    {[...Array(100)].map((e,index) => { return (
      <>{check.includes(index) 
        ? <><div style={{border: '1px solid #333333',textAlign: 'center',minHeight:'30px', minWidth:'40px'}} key={index}></div><br /></> 
        : <><div style={{marginBottom:'-5px',display: 'inline-flex', backgroundColor:cell[Math.floor(index/10)][index%10], border: '1px solid #333333',textAlign: 'center',minHeight:'30px', minWidth:'40px'}} key={index}></div></>}</>
    )})}</div>
    </>
}
